class About extends React.Component {

    render() {
        return (
            <NavLink exact to='/about'>
                <div onClick={this.props.onInfoIconSelect}>
                    <i class="big info circle icon"  style={{padding: "5px 5px 0px 0px"}}/>
                </div>
            </NavLink>
        );
    }
}

export default About;
